INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (36, "", 100, 8, 40000, 0, 0, "", 1, 0, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (37, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 150, 8, 40001, 0, 107501, "ぺコリーヌ", 1, 1, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (38, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 150, 8, 40001, 0, 107601, "コッコロ", 2, 1, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (39, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 150, 8, 40001, 0, 107801, "キャル", 3, 1, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (40, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 150, 8, 40001, 0, 107701, "スズメ", 4, 1, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (41, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 150, 8, 40001, 0, 107901, "タマキ", 5, 1, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (42, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 150, 8, 40001, 0, 107501, "ぺコリーヌ", 6, 2, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (43, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 150, 8, 40001, 0, 107601, "コッコロ", 7, 2, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (44, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 150, 8, 40001, 0, 107801, "キャル", 8, 2, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (45, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 150, 8, 40001, 0, 107701, "スズメ", 9, 2, 91002);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (46, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 150, 8, 40001, 0, 107901, "タマキ", 10, 2, 91002);
