INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 2, 40011, 0, 125801, "リリ", 1, 1, 24001);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 2, 40011, 0, 126001, "クリア", 2, 1, 24001);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (323, "んーと。\nこれ、あげる。\nはい", 1, 2, 40011, 0, 126101, "プレシア", 3, 1, 24001);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 2, 40011, 0, 125801, "リリ", 4, 2, 24001);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 2, 40011, 0, 126001, "クリア", 5, 2, 24001);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (326, "お兄。\nきてくれて、うれしい", 1, 2, 40011, 0, 126101, "プレシア", 6, 2, 24001);
